import React from 'react'
import {Card} from 'antd'

export const SumpixelCard = (props) => {
    return (
        <Card style={{paddingLeft: 20, paddingRight: 20}} title={<img height={43} src={require('../../assets/sumpixel-logo.png')}/>}>
                {props.children}
        </Card>
    )
}
